import React from "react";

const logoutButton = ({ app }) => {
  const { img, href, alt, color, txt, name } = app;

  return (
    <a href={href} title={txt} onClick={null}>
      <img src={img} alt={alt} className="logout-icon" style={{
          minHeight: 10,
          minWidth: 10,
          background: `url("${img}") no-repeat center center / 50% ${color}`,
          width: 25,
          height: 25,
          position: absolute,
          right: 50,
          top: 50,
          padding: 3,
        }}/>
    </a>
  );
};

export default logoutButton;
